defaultValue:
{
  updatesList: {
    capture: '$1',
    translate: {
      "status='(.+?)'": {
        gettext: gettext('status: "{{ status | translate }}"'),
        placeholders: {
          status: '$1'
        }
      },
      "generalStatus='(.+?)'": {
        gettext: gettext('general status: "{{ generalStatus | translate }}"'),
        placeholders: {
          generalStatus: '$1'
        }
      },
      "progress='(.+?)'": {
        gettext: gettext('progress: "{{ progress }}"'),
        placeholders: {
          progress: '$1'
        }
      },
      'note=(.+?)': {
        gettext: gettext('note: "{{ note }}"'),
        placeholders: {
          note: '$1'
        }
      }
    }
  }
}
